import { useNavigate } from "react-router-dom";
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import Grid2 from "@mui/material/Grid2";
import Typography from "@mui/material/Typography";
import { NavbarProps } from "./types/NavbarProps";
import navbar from "./scss/Navbar.module.scss";

const Navbar = (props: NavbarProps) => {
  const navigate = useNavigate();
  const handleClickLogo = () => {
    navigate(props.homeUrl);
  };
  return (
    <Grid2 container className={navbar.viewContainer}>
      {/* <Grid2 container className={navbar.childContentContainer}> */}
      <Grid2 container className={navbar.navbarContainer}>
        <Box className={navbar.box}>
          <AppBar className={navbar.appBar}>
            <Toolbar className={navbar.toolBar}>
              <Grid2 container className={navbar.contentTopContainer}>
                <Grid2
                  container
                  className={navbar.contentContainer}
                  // size={{ xs: 10 }}
                >
                  <Grid2>
                    <Typography
                      className={navbar.logoText}
                      onClick={handleClickLogo}
                    >
                      Chera
                    </Typography>
                  </Grid2>
                  <Grid2>{props.links}</Grid2>
                </Grid2>
              </Grid2>
            </Toolbar>
          </AppBar>
        </Box>
      </Grid2>
      <Grid2 className={navbar.pageContentContainer}>
        {props.childComponent}
      </Grid2>
    </Grid2>
    // </Grid2>
  );
};
export default Navbar;
